import React from 'react';

import {
  Box,
  Container,
  Button,
  Grid,
  Paper,
  Typography,
  TextField,
  MenuItem,
  FormControl,
  FormLabel,
  FormControlLabel,
  RadioGroup,
  Radio,
} from '@mui/material';
import { makeStyles } from '@material-ui/core';

import { XYPlot, ArcSeries } from 'react-vis';

const Graph = ({ macroBreakdown }) => {
  console.log(macroBreakdown);
  return (
    <Box>
      <h1>Graph Placeholder</h1>
      <p>{`Carbs: ${macroBreakdown.carbs}`}</p>
      <p>{`Protien: ${macroBreakdown.protien}`}</p>
      <p>{`Fat: ${macroBreakdown.fat}`}</p>
    </Box>
  );
};

export default Graph;
